[[package]]
name = "isort"
version = "5.10.1"
description = "A Python utility / library to sort Python imports."
category = "dev"
optional = false
python-versions = ">=3.6.1,<4.0"

[package.dependencies]
colorama = {version = ">=0.4.3,<0.5.0", optional = true, markers = "extra == \"colors\""}

